import React from "react";
import logo from "../images/logo.png";

export default function header() {
  return (
    <div>
      <div className="navbar border-b-1 border-b-gray">
        <nav className="mx-auto container my-5">
          <div className="logo">
            <img src={logo} alt="" srcset="" />
          </div>
        </nav>
      </div>
    </div>
  );
}
